import './Services.css'
import HeartEmoji from "../../img/heartemoji.png";
import Glasses from "../../img/glasses.png";
import Humble from "../../img/humble.png"
const Services = () =>{
    return(
        <div className="services">

            { /* left side */}
            <div className="awesone">
                <span>My Awesome</span>
                <span>services</span>
        
                <span>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate aspernatur, ad ipsum omnis et placeat corporis sit amet repudiandae laudantium cumque 
                <br/>
                obcaecati voluptatibus possimus quod quidem excepturi, nihil, nobis ipsa!
                </span>
                <button className="button s-button">Download CV</button>
                <div className="blur s-blur1" style={{background: "#ABF1FF94"}}></div>
            </div>
            {/* right side */}
            <div className="cards"></div>

            I am right side
            
        </div>
    )
}
export default Services;
